import { useState } from 'react';
import logo from '../../assets/userFilter.svg'
import s from './style.module.css'

interface InputAgeFilterProps {
	label: string;
	name: string;
}

export function InputAgeFilter({label, name}) {
	const age = Array.from(Array(82), (_, index) => index + 18);
	const [selectedAge, setSelectedAge] = useState<number>(18);


	return (
		<>
			<label htmlFor="age">
			<img src={logo} alt='logoUser'/>
				Select an age:
			</label>
			<select
				className={s.select}
				name="age"
				value={selectedAge}
				onChange={(e) => setSelectedAge(Number(e.target.value))}
			>
				<option value="">Age</option>
				{age.map((age) => (
					<option key={age} value={age}>
						{age}
					</option>
				))}
			</select>
		</>
	);
}
